import React from "react";
import Radio from "../../../components/radio/Radio";
import Nav from "../../../components/nav/Nav";
import Button from "../../../components/button/Button";


const Level=()=>{
const sayhello=()=>{
    console.log("Hello");
}

    return(
        <div className="container-box">
            What is your highest level of education?
            <Radio name="highSchool" label="High School" value="highScool" onChange={sayhello()} />
            <Radio name="bachelors" label="Bachelors" value="bachelors" />
            <Radio name="masters" label="Masters" value="masters" />
            <Radio name="doctorate" label="doctorate" value="doctorate" />
            <Button className="signupBtn" label="Next"/>
            <Nav pageName="home"/>
        </div>
    )
}

export default Level;
